1. Use the `exit()` function: You can use the `exit()` function to terminate a C program. This function takes an integer argument that represents the exit status of the program. By convention, a return value of 0 indicates successful termination, while a non-zero value indicates an error.

```c
#include <stdlib.h>

int main() {
    // Your program code here

    exit(0); // Terminate the program
}
```

2. Use the `return` statement: You can also use the `return` statement in the `main()` function to terminate the program. This statement can be used to return a value to the operating system.

```c
int main() {
    // Your program code here

    return 0; // Terminate the program
}
```

3. Use the `abort()` function: The `abort()` function can be used to terminate a C program immediately, without performing any cleanup operations. This function is typically used to indicate a critical error condition.

```c
#include <stdlib.h>

int main() {
    // Your program code here

    abort(); // Terminate the program
}
```

These are some of the common ways to terminate a C program. Choose the method that best suits your requirements.

